class AboutPage extends React.Component{
  constructor(props){
    super(props)
    this.state = {}
  }
  render(){
    return (
      <Layout>
        <style>{`
          *{
            text-align: center;
            font-family: Arial;
          }
        `}</style>
        <br/>
        <h1>Who is PDanielY?</h1>
        <p>PDanielY is an unknown specie that lives in a planet called Earth (you may have heard of it). Apparently, he likes to make websites and app. You can contact him with something he calls an email (therealhackermon@gmail.com). </p>
      </Layout>
    )
  }
}
